import React, {useState} from 'react';
import '../styles/navbar.css';
import logo from "../images/logo.png"

function Navbar() {

    return ( 
        <div className = "nav">
            <div className = "leftSide">
                <img src = {logo}/>

            </div>
            <div className = "rightSide">
                <href>News</href>
                <href>Videos</href>
                <href>Reviews</href>
                <href>News</href>
                <href>News</href>

            </div>
        </div>
     );
}

export default Navbar;
